const Footer = () => {
  const footerStyle = {
    color: "green",
    fontStyle: "italic",
    fontSize: 16,
  };

  return (
    <div style={footerStyle}>
      <br />
      <em>
        Blog app made by Leevi Puntanen, Department of Computer Science,
        University of Helsinki 2023
      </em>
    </div>
  );
};

export default Footer;
